def solution(stdin: str) -> str:
    N, M = [int(x) for x in stdin.strip().split(" ")]
    # generate grid
    grid = [[0] * M for _ in range(N)]
    for i in range(N):
        for j in range(M):
            grid[i][j] = int(stdin.strip().split(" ")[j])

    # BFS, try every path
    visited = set()
    for i in range(N):
        visited.add((i, M - 1))
        visited.add((i, 0))
    for j in range(M):
        visited.add((0, j))
        visited.add((N - 1, j))
    visited.add((0, 0))
    visited.add((0, M - 1))
    visited.add((N - 1, 0))
    visited.add((N - 1, M - 1))

    queue = [(0, 0)]
    path = 0
    while len(queue) > 0:
        curr = queue.pop(0)
        if curr in visited:
            path += 1
            continue

        # add neighbors
        neighbors = [
            (curr[0], curr[1] - 1),
            (curr[0] - 1, curr[1]),
            (curr[0], curr[1] + 1),
            (curr[0] + 1, curr[1]),
        ]

        for n in neighbors:
            if n[0] < 0 or n[0] >= N:
                continue
            if n[1] < 0 or n[1] >= M:
                continue
            if grid[n[0]][n[1]] < grid[curr[0]][curr[1]]:
                queue.append(n)
    return str(path)

