            stack.append((quantity, price, 0, 0, 0))
        elif line.startswith('sell'):
            quantity, price = [int(x) for x in line.split()[1:]]
            stack.append((quantity, price, 1, 0, 0))
        elif line.startswith('split'):
            _, quantity = [int(x) for x in line.split()[1:]]
            stack.append((0, 0, 0, quantity, 0))
        elif line.startswith('merge'):
            _, quantity = [int(x) for x in line.split()[1:]]
            stack.append((0, 0, 0, 0, quantity))
        elif line.startswith('die'):
