            stack.append((0, 0, 0, 0, quantity))

    stock = [0] * (10 ** 6 + 1)
    total_cost = 0
    total_profit = 0

    while stack:
        quantity, price, sell_or_buy, remainder, profit = stack.pop()
        if quantity:
            stock[price] += quantity
            total_cost += quantity * price
            total_profit += profit

        if remainder:
            if stock[price] == 0:
                stack.append((0, price, sell_or_buy, remainder, 0))
