def solution(stdin: str) -> str:
    numbers = [int(x) for x in stdin.split(' ')]
    N = len(numbers)
    matrix = [[0] * N for _ in range(N)]
    for i in range(N):
        for j in range(i, N):
            if i == j:
                matrix[i][j] = numbers[i]
            else:
                matrix[i][j] = numbers[i] + numbers[j]
    i = j = 0
    max_area = 0
    while i < N:
        while j < N and matrix[i][j] == 0:
            j += 1
        if j == N:
            break
        min_height = matrix[i][j]
        while j < N and matrix[i][j] <= min_height:
            min_height = matrix[i][j]
            j += 1
        max_area = max(max_area, min_height * (j - i))
        i = j
    return max_area
